  const [user, setUser] = useState(null);

  useEffect(() => {
    setUser(Cookies.getJSON("user"));
  }, []);
  return (
    <div className="Profile">
      <h2 id="chk-heading">Profile</h2>
      <h2 id="chk-content" style={{ textAlign: "center" }}>
        Name: Dhananjayan P N
      </h2>
      <h2 id="chk-content" style={{ textAlign: "center" }}>
        Email: pndjay@gmail.com
      </h2>
      <Button
        onClick={() => {}}
        style={{ marginTop: 30, marginRight: "auto", marginLeft: "auto", display: "block" }}
        id="checkout-button"
        variant="outlined"
        color="secondary"
      >
        SIGN OUT
      </Button>
    </div>
  );
};

export default Profile;
